  +------------------------------------------------------------------------+
  |                         60 entry unified scheduler                     |
  +------------------------------------------------------------------------+
     0 |       1 |      2 |     3 |     4 |      5 |        6 |       7 |
       \/        \/       \/      \/      \/       \/         \/        \/
   +-------+ +-------+ +-----+ +-----+ +-----+ +-------+ +--------+ +------+
   |  ALU  | |  ALU  | |  LD | |  LD | |  ST | |  ALU  | |  ALU & | |SIMPLE|
   +-------+ +-------+ +-----+ +-----+ +-----+ +-------+ |  Shift | |  AGU |
   +-------+ +-------+ +-----+ +-----+         +-------+ +--------+ +------+
   |  2ND  | |  Fast | | AGU | | AGU |         |  Fast | +--------+
   | BRANCH| |  LEA  | +-----+ +-----+         |  LEA  | | BRANCH |
   +-------+ +-------+                         +-------+ +--------+
   +-------+ +-------+                         +-------+
   |AVX DIV| |AVX FMA|                         |  AVX  |
   +-------+ +-------+                         |  ALU  |
   +-------+ +-------+                         +-------+
   |AVX FMA| |AVX MUL|
   +-------+ +-------+
   +-------+ +-------+
   |AVX MUL| |AVX ADD|
   +-------+ +-------+
